  `istop` tinyint(1) DEFAULT '0' COMMENT '置顶 0否 1是',
  `settoptime` int(10) DEFAULT '0' COMMENT '置顶时间',
  `copy_times` int(5) NOT NULL DEFAULT '0',
  `is_hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否爆款',
  PRIMARY KEY (`id`),
  KEY `grounding` (`grounding`)
) ENGINE=InnoDB AUTO_INCREMENT=415 DEFAULT CHARSET=utf8mb4 COMMENT='狮子鱼商城普通商品表';
