  `score_for_money` float(10,2) DEFAULT '0.00' COMMENT '积分抵扣金额',
  `fenbi_li` float(10,2) DEFAULT '0.00' COMMENT '订单中金额占比',
  `total` decimal(15,4) NOT NULL DEFAULT '0.0000',
